import React from 'react'
import { Container, Nav, Navbar } from 'react-bootstrap';
import styled from 'styled-components';
import WelcomeBG from '../assets/welcome-background.png';

import { Link } from 'react-scroll';

const Styles = styled.div`
  @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300&display=swap');

  #welcome-container {
    background: url(${WelcomeBG}) no-repeat fixed bottom;
    background-size: cover;
    height: 100vh;
    width: 100vw;
    max-width: None;
    z-index: -1;
  }

  .big {
    font-family: "Raleway", sans-serif;
    font-size: 15vw;
    max-height: 35vh;
    margin: 10px;
    color: white;
    font-weight: 500;
    z-index: 1;
  }

  .right {
    text-align: right;
  }

  .transparent {
    background-color: None;
    color: white;
    font-family: "Raleway", sans-serif;
  }

  #arrow {
    position: fixed;
    bottom: 0px;
  }

  #name {
    border: solid white 2px;
    padding: 5px;
    color: white;
    margin-left: auto;
    margin-right: auto;
    width: 30vw;
    display: flex;
    justify-content: center;
    align-items: center;

  }
`;

export const Home = () => (
  <Styles>
    <Container id="welcome-container">
      <Navbar className="transparent" variant="dark">
        <Navbar.Brand href="#">EJM</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link>
            <Link activeClass="active" to="about" spy={true} smooth={true} duration={1000}>
              About
            </Link>
          </Nav.Link>
          <Nav.Link href="#">
            <Link activeClass="active" to="experiences" spy={true} smooth={true} duration={1000}>
              Experiences
            </Link>
          </Nav.Link>
          <Nav.Link href="#">Contact</Nav.Link>
        </Nav>
      </Navbar>
      <div id="name">
        <p>Ethan Maltes</p>
      </div>
    </Container>
  </Styles>
)
